// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract Election {
    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    struct Position {
        uint id;
        string title;
        Candidate[] candidates;
    }

    address public admin;
    string public title;
    string public description;
    uint public startDate;
    uint public endDate;
    bool public isLive;

    mapping(uint => Position) public positions;
    mapping(address => bool) public hasVoted;
    event ElectionStarted(string title, uint startDate);
    event Voted(address voter, uint positionId, uint candidateId);
    event ElectionEnded(string title, uint endDate);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier electionLive() {
        require(isLive, "Election is not live");
        _;
    }

    constructor(
        string memory _title, string memory _description, uint _startDate, uint _endDate
    ) {
        admin = msg.sender;
        title = _title;
        description = _description;
        startDate = _startDate;
        endDate = _endDate;
    }

    function addPosition(uint _positionId, string memory _title) public onlyAdmin {
        positions[_positionId] = Position(_positionId, _title, new Candidate[](0));
    }

    function addCandidate(uint _positionId, uint _candidateId, string memory _name) public onlyAdmin {
        positions[_positionId].candidates.push(Candidate(_candidateId, _name, 0));
    }

    function startElection() public onlyAdmin {
        require(block.timestamp >= startDate, "Election start date not reached");
        isLive = true;
        emit ElectionStarted(title, startDate);
    }

    function vote(uint _positionId, uint _candidateIndex) public electionLive {
        require(!hasVoted[msg.sender], "You have already voted");
        positions[_positionId].candidates[_candidateIndex].voteCount++;
        hasVoted[msg.sender] = true;
        emit Voted(msg.sender, _positionId, _candidateIndex);
    }

    function endElection() public onlyAdmin {
        require(block.timestamp >= endDate, "Election end date not reached");
        isLive = false;
        emit ElectionEnded(title, endDate);
    }

    function getCandidateVotes(uint _positionId, uint _candidateIndex) public view returns (uint) {
        return positions[_positionId].candidates[_candidateIndex].voteCount;
    }
}

